// src/components/Dashboard.js
import React from 'react';
import { Link } from 'react-router-dom';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend } from 'recharts';

// Hardcoded product data
const products = [
    { name: "Product A", quantity: 40 },
    { name: "Product B", quantity: 25 },
    { name: "Product C", quantity: 70 },
    { name: "Product D", quantity: 50 }
];

const Dashboard = () => {
    return (
        <div style={{ padding: '20px' }}>
            <header style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
                <h2>Dashboard</h2>
                <nav>
                    <Link to="/product-management" style={{ marginRight: '15px' }}>Product Management</Link>
                    <Link to="/user-management">User Management</Link>
                </nav>
            </header>

            <div style={{ marginTop: '20px', textAlign: 'center' }}>
                <h3>Product Quantities</h3>
                <BarChart
                    width={600}
                    height={300}
                    data={products}
                    margin={{ top: 20, right: 30, left: 20, bottom: 5 }}
                >
                    <CartesianGrid strokeDasharray="3 3" />
                    <XAxis dataKey="name" />
                    <YAxis />
                    <Tooltip />
                    <Legend />
                    <Bar dataKey="quantity" fill="#8884d8" />
                </BarChart>
            </div>
        </div>
    );
};

export default Dashboard;
